import React, {useState,useEffect} from 'react'
import PostItem from './Post Item/PostItem'

export default function DebugStress() {
  const url = 'http://127.0.0.1:8000/posts/';

  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);

  const getData = async () => {
    const response = await fetch(url);
    const data = await response.json();

    const maindata = data.filter((item) => item.type === "Funny")
    setPosts(maindata);
    setLoading(false);
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <>
      {loading ? (
        <div className="col-md-12 d-flex justify-content-center">
        <div class="spinner-border text-info m-auto" role="status">
          <span class="visually-hidden"></span>
        </div>
      </div>
      ) : (
        <>
          {posts.map((item) => (
            (item.type === "Funny")? <div key={item.post_id}><PostItem title={item.title}/></div>: null
          ))}
        </>
      )}
    </>
  );

}
